    parserSubsetset_extra (yy_user_defined, &dummy_yyguts);

    if (ptr_yy_globals == nullptr){
        errno = EINVAL;
        return 1;
    }
	
    *ptr_yy_globals = (yyscan_t) parserSubsetalloc ( sizeof( struct yyguts_t ), &dummy_yyguts );
	
